import React from "react";

import { Wrapper, Content, Image, Text } from "./HeroImage.styles.js";


const HeroImage = ({source, playlists}) => {

  console.log(playlists, "Hero")
  return (
  <>

    <Wrapper>
      <Content>
        <Image src={source} alt="playlist"/>
        <Text>
        <h1>{playlists.name}</h1>
        <p className="display">{playlists.owner.display_name}</p>
        <p>{`${playlists.tracks.total} songs`}</p>
        </Text>
      </Content>
    </Wrapper>
    </>
  )};

  export default HeroImage;
